webpackJsonp([24366969501270],{827:function(e,t){e.exports={data:{markdownRemark:{html:'<p>With the Trac integration, HackerOne makes it easy for you to link Trac issues as references on the platform.</p>\n<p>In order to configure the Trac integration for your team, <a href="https://support.hackerone.com/hc/en-us/requests/new">contact HackerOne</a> with the following information:</p>\n<ul>\n<li>The base URI of the Trac instance (e.g. <a href="https://trac.company.com/">https://trac.company.com/</a>)</li>\n<li>The component you\'d like issues to default to</li>\n<li>The type you\'d like issues to default to</li>\n<li>Any other custom keywords/fields you\'d like prepopulated. Options are described here: <a href="http://trac.edgewall.org/wiki/TracTickets#PresetValuesforNewTickets">http://trac.edgewall.org/wiki/TracTickets#PresetValuesforNewTickets</a></li>\n</ul>\n<p>With all of the provided information, HackerOne will be able to set up your requested integration. You’ll get an email notification letting you know that your integration has been set up within 1-2 business days.</p>\n<h3>How the Integration Works</h3>\n<p>After your Trac integration has been set up:</p>\n<ol>\n<li>Change the action picker to <strong>Change state > Triaged</strong> in your report.</li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/integrations-f07e0d0182f92c853be1bd8a39743b15-03cd7.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 48.708010335917315%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="integrations"\n        title=""\n        src="/static/integrations-f07e0d0182f92c853be1bd8a39743b15-2f183.png"\n        srcset="/static/integrations-f07e0d0182f92c853be1bd8a39743b15-67829.png 125w,\n/static/integrations-f07e0d0182f92c853be1bd8a39743b15-5c59f.png 250w,\n/static/integrations-f07e0d0182f92c853be1bd8a39743b15-2f183.png 500w,\n/static/integrations-f07e0d0182f92c853be1bd8a39743b15-c93e8.png 750w,\n/static/integrations-f07e0d0182f92c853be1bd8a39743b15-4e628.png 1000w,\n/static/integrations-f07e0d0182f92c853be1bd8a39743b15-b3ac4.png 1500w,\n/static/integrations-f07e0d0182f92c853be1bd8a39743b15-03cd7.png 1548w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ol start="2">\n<li>Click <strong>Escalate</strong>.</li>\n<li>You’ll be taken to your Trac account where the report is pre-populated. Submit the issue to create the report in Trac.</li>\n<li>Copy the Trac report issue number and paste it in the <strong>Reference ID</strong> field of the HackerOne report to create a direct reference link to the issue in Trac.  </li>\n</ol>',frontmatter:{path:"/programs/trac-integration.html",id:"programs/trac-integration",title:"Trac Integration",description:null}}},pathContext:{}}}});
